using ShineEngine;

/// <summary>
/// 场景服登录消息(generated by shine)
/// </summary>
public class SceneLoginRequest:SceneRequest
{
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=SceneRequestType.SceneLogin;
	
	public SceneLoginRequest()
	{
		_dataID=SceneRequestType.SceneLogin;
	}
	
	protected override void copyData()
	{
		base.copyData();
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "SceneLoginRequest";
	}
	
	/// <summary>
	/// 写入字节流(完整版)
	/// </summary>
	protected override void toWriteBytesFull(BytesWriteStream stream)
	{
		base.toWriteBytesFull(stream);
		
		stream.startWriteObj();
		
		stream.endWriteObj();
	}
	
	/// <summary>
	/// 创建实例
	/// </summary>
	public static SceneLoginRequest create()
	{
		SceneLoginRequest re=(SceneLoginRequest)BytesControl.createRequest(dataID);
		return re;
	}
	
}
